【製品名】<br><br>

RGBフットランプキット<br><br>



【動作状況】<br><br>
iOS・Androidのシステムバージョンアップにより操作が困難になる場合が御座います。
その場合、対応アプリが数種類御座いますのでアップデート等を行って下さい。

iOS：10.2まで確認済 / Android：4.3以上 (2017.2.1現在)
<br>
【商品説明】<br>

お手持ちのスマホがリモコンに変わる!!<br>
Bluetoothで簡単接続、点灯コントロール可能なRGBフットランプキット。 <br>
専用アプリをダウンロードして接続するだけで、点灯パターンや照度を変更可能になります。<br>
更に設定する事で1,677万色のカラーと、点灯・フェード・点滅等を組み合わせてオリジナルのパターンも設定可能です。 <br>
スマホに入れた音楽と連動する新機能も追加!!<br><br>
車内空間をもっと楽しもう!!!

※非防水となっておりますので、車内用イルミネーションとしてご使用下さい。<br><br>

【送料】<br><br>

全国一律 864円
※北海道/沖縄県/離島は別途必要<br><br><br>


